import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import BasicSelect from '../../components/IdeaComponents/Select';
import Divider from '@mui/material/Divider';

const style = {
    width: '100%',
    maxWidth: 360,
    bgcolor: 'background.paper',
  };

const AddIdea = () => {
  return (
    <Box component = 'form' sx={style}>
        <div>
            <TextField id="ideaName" label="Name of Idea" variant="standard" />
            <Divider />
        </div>
        <div>
            <TextField id="ideaDescription" label="Description" variant="standard" />
            <Divider />
        </div>
        <div>
            <BasicSelect />
            <Divider />
        </div>
        <Button variant="contained">Submit</Button>
        <Divider />
    </Box>
  )
}

export default AddIdea
